import React from "react";

const Navitem = () => {
  return (
    <>
      <a href="home">home</a>
      <a href="#about">about</a>
      <a href="#service">service</a>
      <a href="#experience">experience</a>
      <a href="#portfolio">portfolio</a>
      <a href="#contact">contact</a>
    </>
  );
};

export default Navitem;
